import React from 'react';

const LeftSide = ({ leftActiveTab, setLeftActiveTab }) => {
  return (
    <div className="left-side">
      <h2>Navigation</h2>
      <nav>
        <ul>
          <li
            className={leftActiveTab === 'illustrations' ? 'active' : ''}
            onClick={() => setLeftActiveTab('illustrations')}
          >
            Illustrations
          </li>
          <li
            className={leftActiveTab === 'appdesign' ? 'active' : ''}
            onClick={() => setLeftActiveTab('appdesign')}
          >
            App Design
          </li>
          <li
            className={leftActiveTab === 'webdesign' ? 'active' : ''}
            onClick={() => setLeftActiveTab('webdesign')}
          >
            Web Design
          </li>
          <li
            className={leftActiveTab === 'bookcovers' ? 'active' : ''}
            onClick={() => setLeftActiveTab('bookcovers')}
          >
            Book Covers
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default LeftSide;
